import { Container, Row, Col } from 'react-grid-system';


export default () => {
    return <div>
        <style global jsx>{`
        body {
          margin: 0;
          padding: 0;
          background: #FCF9E9;
          -moz-osx-font-smoothing: grayscale;
          -webkit-font-smoothing: antialiased;
          -webkit-backface-visibility: hidden;
          font-family: -apple-system, BlinkMacSystemFont, 'Segoe UI', Roboto, Oxygen, Ubuntu, Cantarell, 'Open Sans', 'Helvetica Neue', sans-serif;
        }
        a{
            color: black;
        }
      `}</style>
        <div style={{ height: 70 }}>
            <Container>
                <Row>
                    <Col md={6} style={{ lineHeight: "70px" }}><img src="/logo.svg" /></Col>
                    <Col md={6} style={{ textAlign: "right", lineHeight: "70px" }}><a href="#">Terms of Use</a></Col>
                </Row>
            </Container>
        </div>
    </div>
}
